import { useState, useEffect } from "react";
import axios from "axios";

function SessionsAverage(id) {
  const [sessionsAverage, setSessionsAverage] = useState(null)

  useEffect(() => {
    axios.get(`http://localhost:3000/user/12/average-sessions`)
    .then((response) => {
      setSessionsAverage(response.data)
    })
  }, [id])

  return (
    <div >
      <h1>Activity graph</h1>
      <p>{sessionsAverage?.data.userId}</p>
    </div>
  );
}

export default SessionsAverage;
